703.heap - 数据流中的第K大元素

思路
第K大，用小顶堆；第K小，用大顶堆；维护容量为K的堆。
小顶堆，堆顶就是第K小；大顶堆，堆顶是第K大。
代码
import java.util.PriorityQueue;
import java.util.Queue;

